import React from 'react'
import { useWindowScroll } from 'react-use';
import styled from 'styled-components'
import { useRef, useLayoutEffect } from 'react'
import { Link } from 'react-router-dom';
import { Typography } from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import Alert from '@mui/material/Alert';
import Stack from '@mui/material/Stack';

const theme = createTheme({
  typography: {
    fontFamily: [
      'Poppins',
      'sans-serif'
    ].join(','),
  }
});
theme.typography.h4 = {
  fontSize: '3em',
  [theme.breakpoints.up('lg')]: {
    fontSize: '3em'
  },
  [theme.breakpoints.down('lg')]: {
    fontSize: '3em'
  },
  [theme.breakpoints.down('md')]: {
    fontSize: '1em'
  },
  [theme.breakpoints.down('sm')]: {
    fontSize: '0.875em'
  },
  [theme.breakpoints.down('xs')]: {
    fontSize: '0.75em'
  },
};

theme.typography.h5 = {
  fontSize: '1em',
  [theme.breakpoints.up('lg')]: {
    fontSize: '1em'
  },
  [theme.breakpoints.down('lg')]: {
    fontSize: '1em'
  },
  [theme.breakpoints.down('md')]: {
    fontSize: '0.875em'
  },
  [theme.breakpoints.down('sm')]: {
    fontSize: '0.75em'
  },
  [theme.breakpoints.down('xs')]: {
    fontSize: '0.6em'
  },
};

const EmptyContainer = styled.div`
width: 80vw;
display: flex;
margin: auto;
padding: 1%;
display: flex;
justify-content: space-between;
align-items: center;
`

const Left = styled.div`
color: ${props => props.theme.text};
/* background-color: ${props => props.theme.logoColor}; */
/* padding: 1%; */
/* margin: C1%; */
font-size: ${props => props.theme.fontxl};
cursor: pointer;
@media (max-width: 70em) {
font-size: ${(props) => props.theme.fontlg};
}
@media (max-width: 48em) {
font-size: ${(props) => props.theme.fontmd};
}
@media (max-width: 40em) {
font-size: ${(props) => props.theme.fontsm};
}

display: flex;
transition: all 0.3s ease;
&:hover{
    transform: scale(1.2);
}
&:active{
    transform: scale(0.9);
}

`
const Right = styled.div`
color: ${props => props.theme.text};

font-size: ${props => props.theme.fontxl};

cursor: pointer;
display: flex;
@media (max-width: 70em) {
font-size: ${(props) => props.theme.fontlg};
}
@media (max-width: 48em) {
font-size: ${(props) => props.theme.fontmd};
}
@media (max-width: 40em) {
font-size: ${(props) => props.theme.fontsm};
}
transition: all 0.3s ease;
&:hover{
    transform: scale(1.2);
}
&:active{
    transform: scale(0.9);
}
`

const Next = ({ LeftLink, LeftText, RightLink, RightText }) => {

  return (
    <EmptyContainer>
        <Link underline='none' to={LeftLink}>
          <Left > 
            <Alert icon={false} severity="info" variant="outlined">
              
      <ThemeProvider theme={theme}>

      <Typography gutterBottom variant="h5" component="div" align="center">
                &#x2190; {LeftText}
              </Typography>
      </ThemeProvider>
            </Alert>
          </Left>
        </Link>
        <Link underline='none' to={RightLink}>
          <Right >
            <Alert icon={false} severity="info" variant="outlined">
              <Typography gutterBottom variant="h5" component="div" align="right">
                {RightText} &#x2192;
              </Typography>
            </Alert>
          </Right>
        </Link>
    </EmptyContainer>
  )
}

export default Next
